import './styling/App.css';

function App() {
  return (
    <div className="App">
      <button onClick={getSpells}/>
    </div>
  );
}

function getSpells() {
  fetch(`http://127.0.0.1:5555/spells`)
        .then((r) => r.json())
        .then(console.log())
}

export default App;
